import CardList from "./CardList";
import { robots } from "./robots";
import Searchbox from "./Searchbox";
import { render } from "@testing-library/react";

const state = {
  robots: robots,
  searchfield: "",
};

class App extends Component {
  render() {
    return (
      <div className="tc">
        <h1>RoboFriends</h1>
        <Searchbox />
        <CardList robots={robots} />;
      </div>
    );
  }
}

export default App;
